const utf8 = require('utf8')
const sharp = require('sharp')

exports.handler = async function (event) {
  try {
    let textArray = []
    let line = ''
    const offset = 31
    let text = 'Home of fearless web developer Silvestar BistroviÄ‡'

    if(event.queryStringParameters && event.queryStringParameters.text) {
      text = event.queryStringParameters.text
    }

    let words = text.split(' ')

    for (let i = 0; i < words.length; i++) {
      if(line.length + words[i].length < offset) {
        line.length += words[i].length;
        line += ` ${words[i]}`
      } else {
        textArray.push(line)
        line.length = words[i].length
        line = words[i]
      }

      if (i === words.length - 1) {
        textArray.push(line)
      }
    }

    const yPosition = 320
    const yOffset = 65
    let tspan = ''

    for (let i = 0; i < textArray.length; i++) {
      if(i < 4) {
        tspan += `<tspan x="160" y="${yPosition + (yOffset * i)}">${utf8.encode(textArray[i].trim())}</tspan>`
      }
    }

    const svg = `<svg width="1200" height="630" viewBox="0 0 1200 630" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink"><rect width="1200" height="630" rx="20" fill="white"/><rect x="56" y="56" width="1088" height="518" rx="15" stroke="#FF3366" stroke-width="14"/><rect x="151" y="111" width="428" height="133" fill="url(#pattern0)"/><rect x="1030" y="544" width="60" height="60" fill="url(#pattern1)"/><defs><pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1"><use xlink:href="#image0_1435_268" transform="matrix(0.00135685 0 0 0.00436641 0 -0.0021373)"/></pattern><pattern id="pattern1" patternContentUnits="objectBoundingBox" width="1" height="1"><use xlink:href="#image1_1435_268" transform="scale(0.000801282)"/></pattern><image id="image0_1435_268" width="737" height="230" xlink:href="data:image/png;base64,"/><image id="image1_1435_268" width="1248" height="1248" xlink:href="data:image/png;base64,"/></defs><style>text{font-family:Inter,Roboto,'Helvetica Neue','Arial Nova','Nimbus Sans',Arial,sans-serif;font-size:55px;font-weight:500;fill:#000;stroke:#000;overflow:hidden}</style><text id="text2" x="160" y="279">${tspan}</text></svg>`

    const img = await sharp(Buffer.from(utf8.decode(svg)))
      .png()
      .toBuffer()

    return {
      statusCode: 200,
      body: img.toString('base64'),
      headers: {
        'content-type': 'image/png'
      },
      isBase64Encoded: true,
    }
  } catch (error) {
    console.log(error)

    return {
      statusCode: 200,
      body: 'Error!',
      headers: {
        'content-type': 'text'
      }
    }
  }
}
